posts:
- {by_profile_id: !!python/unicode '7bdb758e-b2cd-4790-91ea-e51b61f9929b', changed: !!python/unicode '2015-11-04T21:05:37.775738+00:00',
  content: !!python/unicode '

    We just tested Arbiter on electric.com and saveonenergy.com and saw great results.
    We are looking for more jobs to stress test the system. If you''re interest or
    know anyone who might be, let me know!


    Successes:

    - Arbiter found 100 issues on the energy sites electric.com and saveonenergy.com.
    Of these issues about 50 were serious (competitor products not showing up on the
    competitor page) and the others were misnamed competitor names/values. These issues
    have all been addressed.

    - On Friday we found an additional 12 issues on electric.com which were more competitor
    products not showing up along with a couple of issues with EMP serving the default
    experience instead of the competitor experience.

    - Full write up here: some shared document or another Luno post.


    New features:

    - The piece of arbiter that runs jobs was refactored to be more reliable, scalable,
    and efficient (uses less memory).

    - Link scan assertion: this assertion will check all the URLs on a page to see
    if they return a 200 status code

    - CSV import: instead of copy pasting a CSV into arbiter you can pick a file to
    upload


    Upcoming features:

    - HTTP Authentication: this will allow you to sign into staging/QA sites

    - Counting elements: arbiter will count the number of elements that match a specific
    selector and use that in assertions so if you expect that there are 45 products
    on a product grid HTTPll be able to check that.you

    - Setting cookies: some pages have cookie based authentication so Countingre adding
    a way for you to set that in arbiterwe


    Settingre also working on multiple browser support right now (IE8-11, firefox,
    opera, chrome, android, iOS) so we can tell when someone deploys code that makes
    IE8 look like garbage or when one of the grids is showing the wrong price. In
    the admin tool Settingd love for it to be point and click. For example you tell
    arbiter what URL you want to test, it loads the page, and you click on specific
    things on the page to run tests against. These are way down the road but Settings
    the end goal.thatIWe


    If you have any feedback or feature request, let me know!', created: !!python/unicode '2015-11-04T21:05:37.775716+00:00',
  id: !!python/unicode '0dbe8e92-e4dd-417d-b1cb-bffb1cb01474', organization_id: !!python/unicode '9ba9cbb2-c886-4fc7-a17c-df80b1a8f7ba',
  title: !!python/unicode 'Arbiter - October 26th Update'}
- {by_profile_id: !!python/unicode '7bdb758e-b2cd-4790-91ea-e51b61f9929b', changed: !!python/unicode '2015-11-04T21:04:09.239224+00:00',
  content: !!python/unicode "\nArbiter is a functional testing framework built on\
    \ webdriver.io/selenium to solve a variety of compliance/functionality issues.\
    \ Functional testing just means that it tests the functionality of the site without\
    \ worrying about the underlying code.\n  \nThe end goal is to have a system upon\
    \ which we can test all sites at RV without the need for a person to manually\
    \ check each page. This is crucial as re constantly adding sites and Red Ventures\
    \ virtual footprint increases.we\n  \ns How Itsection on this page http://confluence.redventures.net/display/AR/Developer%27s+Guide,\
    \ which is a bit technical, but ping me if you have any questions. Worksa There\n\
    \nSpecial thanks to @Justin Robinson who wrote the first version of Arbiter.\n",
  created: !!python/unicode '2015-11-04T21:04:09.239202+00:00', id: !!python/unicode '57268635-16aa-41d8-b0bd-c941316c28df',
  organization_id: !!python/unicode '9ba9cbb2-c886-4fc7-a17c-df80b1a8f7ba', title: !!python/unicode 'What
    is Arbiter?'}
